import{_ as s,o,c as r,a}from"./app.d99cad5f.js";const n="/developer-toolbox/recurrence/knowledge/maslowPyramid.jpeg",i="/developer-toolbox/assets/dikw-pyramid.e627fe34.png",t="/developer-toolbox/assets/set.fb2e8bab.png",e="/developer-toolbox/assets/recursiveSet.02034807.png",d="/developer-toolbox/assets/you.e99b394f.png",l="/developer-toolbox/assets/woman.37175c11.png",c="/developer-toolbox/assets/setClass.a8901f5e.png",h="/developer-toolbox/assets/abstractRecursiveSet.b7b24fbd.png",x=JSON.parse('{"title":"Knowledge","description":"","frontmatter":{},"headers":[{"level":2,"title":"Why? \u{1F914}","slug":"why-\u{1F914}","link":"#why-\u{1F914}","children":[]},{"level":2,"title":"What? \u{1F913}","slug":"what-\u{1F913}","link":"#what-\u{1F913}","children":[]},{"level":2,"title":"For what? \u{1F632}","slug":"for-what-\u{1F632}","link":"#for-what-\u{1F632}","children":[]},{"level":2,"title":"How? \u{1F9D0}","slug":"how-\u{1F9D0}","link":"#how-\u{1F9D0}","children":[{"level":3,"title":"Sets","slug":"sets","link":"#sets","children":[]}]}],"relativePath":"learn/recurrence/knowledge/index.md","lastUpdated":1665342091000}'),g={name:"learn/recurrence/knowledge/index.md"},m=a('<h1 id="knowledge" tabindex="-1">Knowledge <a class="header-anchor" href="#knowledge" aria-hidden="true">#</a></h1><h2 id="why-\u{1F914}" tabindex="-1">Why? \u{1F914} <a class="header-anchor" href="#why-\u{1F914}" aria-hidden="true">#</a></h2><p>Why do we want to study and understand knowledge?</p><p>Because we can only observe the world from our perspective, our shoes. Knowledge is what allowed our ancestors to survive and eat the things that would not kill us.</p><p><strong>Maslow pyramid</strong></p><p><img src="'+n+'" alt="Maslow pyramid"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Nowadays in order to survive we need a job and thus (as software engineers) <strong>knowledge of our craft</strong> is what will allow us to cover our physiological needs and <strong>survive</strong>.</p></div><h2 id="what-\u{1F913}" tabindex="-1">What? \u{1F913} <a class="header-anchor" href="#what-\u{1F913}" aria-hidden="true">#</a></h2><p><strong>DIKW Pyramid</strong></p><p><img src="'+i+'" alt="DIKW pyramid"></p><table><thead><tr><th>Level</th><th>Definition</th><th>Examples</th></tr></thead><tbody><tr><td><strong>Noise</strong></td><td>Physic signal (visual, audible...) not standardized, without pattern.</td><td><em>\xF1laksjdfk, xxi, k34hsksi29sk2, ]})\xBF:?({#!!, :-*, \u2026\u200B, kid clapping, hit the piano keys...</em></td></tr><tr><td><strong>Data</strong></td><td>Magnitude of some concrete qualitative or quantitative characteristic, without context or meaning, with a precise. <strong>format</strong></td><td><em>1850, 7009.7 thousands of millions, 9,6%, (, ., !, 8-o,...</em></td></tr><tr><td><strong>Information</strong></td><td>Application of <strong>structured order</strong> over data with the goal of giving them meaning. Information is organized data, related element inside a system structure, describes in a concise <strong>language</strong></td><td><em>1850 son las retrasmisiones en directo de las campanadas de fin de a\xF1o que emocionaron al 9,6% de los 7009.7 miles de millones de personas que lo celebramos en 2014 a la vez, decimocuarto aniversario anual dentro del siglo xxi.</em></td></tr><tr><td><strong>Knowledge</strong></td><td><strong>Comprehend</strong> a specific subject, trough experience or education. It builds on top of information to provide context. The key difference between knowledge and information is that knowledge gives us power to make decisions.</td><td><em>You know how to hang out parties you usually attend</em></td></tr><tr><td><strong>Wisdom</strong></td><td>Is the <strong>optimal judgement</strong>, which reflects a deep understanding of people, things, events or situations.</td><td><em>Knows how to enjoy being with others in any party</em></td></tr></tbody></table><h2 id="for-what-\u{1F632}" tabindex="-1">For what? \u{1F632} <a class="header-anchor" href="#for-what-\u{1F632}" aria-hidden="true">#</a></h2><p>To obtain <strong>effective</strong> and <strong>efficient solutions</strong> from <strong>complex systems</strong> in any <strong>productive sector</strong>.</p><p>In order to exploit all resources in the universe we need to study, investigate, analyze, synthesize and know them.</p><h2 id="how-\u{1F9D0}" tabindex="-1">How? \u{1F9D0} <a class="header-anchor" href="#how-\u{1F9D0}" aria-hidden="true">#</a></h2><h3 id="sets" tabindex="-1">Sets <a class="header-anchor" href="#sets" aria-hidden="true">#</a></h3><table><thead><tr><th>Definition</th><th>Concrete</th></tr></thead><tbody><tr><td>A set is an <strong>unordered collection</strong> of <strong>not repeated elements</strong>, <strong>associated by a pattern</strong></td><td><img src="'+t+'" alt="set"></td></tr><tr><td>A <strong>recursive set</strong> is one <strong>whose elements can also be other sets</strong>.</td><td><img src="'+e+'" alt="Recursive set"></td></tr></tbody></table><h4 id="objects-and-classes" tabindex="-1">Objects and Classes <a class="header-anchor" href="#objects-and-classes" aria-hidden="true">#</a></h4><table><thead><tr><th>Objects</th><th>Classes</th></tr></thead><tbody><tr><td>An <strong>object</strong> is a set of elements which are other <strong>objects</strong> which at the same time... <strong>recursively</strong>!</td><td>A <strong>class</strong> is a set whose elements are the <strong>common characteristics of another set of similar objects</strong></td></tr><tr><td><em>That peach! The peach I ate; the third peach in the basket, a bit red, that one!</em></td><td><em>Prunus persica, the peach is a deciduous tree first domesticated and cultivated in Zhejiang province of Eastern China...</em></td></tr><tr><td>@&gt;\u2192---</td><td><em>An emoticon short for &quot;emotion icon&quot;, also known simply as an emote, is a pictorial representation of a facial expression using characters\u2014usually punctuation marks, numbers, and letters\u2014to express a person&#39;s feelings, mood or reaction, or as a time-saving method</em></td></tr><tr><td>A real or virtual being with concrete values in its characteristics</td><td><em>A book, a desription, a definition of its common characteristics, without concrete</em> values</td></tr><tr><td><img src="'+d+'" alt="you"></td><td><img src="'+l+'" alt="woman"></td></tr><tr><td><strong>Focus</strong> on a <strong>set of objects</strong> that <strong>collaborate a lot</strong>, with <strong>high cohesion</strong> and <strong>low coupling</strong>, regardless of their similarity.<br><br><em>A human body is a set of head, trunk, four extremities --&gt; no similarity</em><br><br><em>A swarm is a group of bees --&gt; similar</em></td><td><strong>Focus</strong> on a <strong>set of common characteristics of a set of objects that are similar</strong>, regardless of whether they <strong>collaborate a lot or not</strong>.<br><br><em>The Human, they collaborate between them to the point they are kings of the world even though there are other superior species in strength, speed...</em><br><br><em>The service of gas stations, which do not collaborate between them</em></td></tr><tr><td><img src="'+t+'" alt="set"></td><td><img src="'+e+'" alt="Recursive set"></td></tr><tr><td><img src="'+c+'" alt="Set class"></td><td><img src="'+h+'" alt="Abstract recursive set"></td></tr></tbody></table><h4 id="abstract-classes" tabindex="-1">Abstract classes <a class="header-anchor" href="#abstract-classes" aria-hidden="true">#</a></h4><p>An abstract class is the intersection set of common characteristics from a set of similar classes.</p><ul><li>Living being <ul><li>Plants</li><li>Fungi</li><li>Animals <ul><li>Invertebrates</li><li>Vertebrates <ul><li>Fishes</li><li>Mammals <ul><li>Canines</li><li>Felines</li><li>Primates <ul><li>Monkeys</li><li>Humans</li></ul></li></ul></li></ul></li></ul></li></ul></li></ul>',22),u=[m];function p(b,w,f,v,y,_){return o(),r("div",null,u)}const A=s(g,[["render",p]]);export{x as __pageData,A as default};
